	public void addTorrnet() 
	{
		//String filepath = "/storage/sdcard0/Download/ubuntu-11.10-desktop-i386.iso.torrent";
		String filepath = "/sdcard/ubuntu-11.10-desktop-i386.iso.torrent";
		File file = new File(filepath);
		InputStream inputStream = null;
		try
		{
			inputStream = new FileInputStream(file);
		} catch (FileNotFoundException e1)
		{
			e1.printStackTrace();
		}
		
		
		byte[] bytes;
		byte[] buffer = new byte[8192];
		int bytesRead;
		ByteArrayOutputStream output = new ByteArrayOutputStream();
		try {
			while ((bytesRead = inputStream.read(buffer)) != -1) {
				output.write(buffer, 0, bytesRead);
			}
		} catch (IOException e) {
			e.printStackTrace();
		}
		bytes = output.toByteArray();
		String encodedString = Base64.encodeBytes(bytes);
		encodedString = "";
		Log.d("aria2 Test",encodedString);
		String result = aria2.addTorrent(bytes);
	}
	
	

